import React, {useState} from 'react';
import logo from '../foto/1.jpg';
import logo2 from '../foto/2.jpg';
import logo3 from '../foto/3.jpg';
import logo4 from '../foto/4.jpg';
import logo5 from '../foto/5.jpg';
import logo6 from '../foto/6.jpg';
import {Container, Row	, Col, Card, CardGroup} from 'react-bootstrap';




function MomentKeluarga () {

const [kumpulan, setKumpulan] = useState('logo','logo2','logo3', 'logo4', 'logo5', 'logo6');


const gayaText = {
	fontFamily : ' Arial, sans-serif',
	fontSize : '18px',
	color : 'gray'
}



	return (
		<Container>
		<br />
			<Row>
				<Col sm={4}>
					<a className="text-muted">Today</a>
				</Col>
			</Row>
			<Row>
				<CardGroup>
				  <Card>
				    <Card.Img variant="top" src="holder.js/100px160" />
				    <Card.Body>
				      <Card.Title>Card title</Card.Title>
				      <Card.Text>
				        This is a wider card with supporting text below as a natural lead-in to
				        additional content. This content is a little bit longer.
				      </Card.Text>
				    </Card.Body>
				    <Card.Footer>
				      <small className="text-muted">Last updated 3 mins ago</small>
				    </Card.Footer>
				  </Card>
				  </CardGroup>
			</Row>
		</Container>

		)
}

export default MomentKeluarga;
